  const [l_name, set_lastName] = useState(props.l_name);
  const [email, set_email] = useState(props.email);

  return (
    <div className="employee-item">
      <div >
        <lable>{id}</lable>
      </div>
      <div>
        <lable>{f_name}</lable>
      </div>
      <div>
        <lable>{l_name}</lable>
      </div>
      <div>
        <lable>{email}</lable>
      </div>
      <div>
        <button>Update</button>
      </div>
      <div></div>
    </div>
  );
}

